(19," Myopia, or widely known as near-sightedness, occurs when the eyeball is too long so it affects how the cornea and lens focus. This means objects in the distance appear blurry because light rays are focusing at the front of the retina rather than at the back of the retina. How much time you spend outside and indoors can also affect your eye sight. Spending too much time doing near work like reading, writing, watching can definitely trigger myopia. Although the contrasts between outdoor and indoor will vary depend on how you do your work. The eye condition is also more common in some demographics. For instance, myopia is more prevalent in people with Asian culture like Singapore. Students have their computers, ipads that they used in their classes. You can see at the photo that almost all the students are wearing their glasses. "),Yo(),Yo(),Go(20,"div",5),Xo(21,"img",8),Yo(),Go(22,"div",6),Go(23,"label"),ma(24," Have You Ever Wondered? "),Yo(),Yo(),Go(25,"div",5),Go(26,"label"),ma(27," We are talking about native people of a forested area or people who lives in the forest. Those people have 20/20 or better than perfect vision why? Because they dont have gadgets, books or anything that they can use for hours in their free time. They dont go to school to read books or to write. What they usually do is hunting, roaming around the forest, searching for food and etc... That kind of lifestyle free from bad habits sharpens their eyesight. "),Yo(),Yo(),Go(28,"div",6),Go(29,"label"),ma(30," What Should I Do Now? "),Yo(),Yo(),Go(31,"div",4),Go(32,"label"),ma(33," Now you have a good grasp of how people get myopia and the understanding of its causes. What you have to do is basically learn from their mistakes like their bad habits. Implement good habits in your lifestyle like going outside for walk, looking at the distance, avoid too much close up work. Enjoying the sunrise in the morning and many more activities that you can enjoy by yourself. "),Yo(),Yo(),Go(34,"div",7),G